globdecl.text:
color INT = int;
color DATA = string; 
color INTxDATA = product INT * DATA
           declare output_col, input_ms;
var n, k : INT;
var p,str : DATA;
val stop = "########";

color Ten0 = int with 0..10;
color Ten1 = int with 1..10;
var s : Ten0;  var r : Ten1;
fun Ok(s:Ten0,r:Ten1) = (r<=s);

color E = with e; 
var packets : INTxDATA ms;
globref outfile = TextIO.stdOut;

code.text:
input (n,p,k);
action
if n=k
then
   (if n=1
        then outfile:=TextIO.openOut("SimpleProtocol.SimRes")
        else ();
    output_col'INTxDATA(!outfile,(n,p));
     if p=stop then TextIO.closeOut(!outfile) else ())
else ();

output packets;
action
let
   val infile=TextIO.openIn(DSFile_NameDialog
                  {prompt="Select Input File", okButtonLabel="Load",
                    path="", writeBox=false});
   val message=input_ms'INTxDATA(infile)
in
   TextIO.closeIn(infile);
   message
end handle ? => empty;
